
data = ''
result = ''
j = 0
try:
    while True:
        i = 0
        str_1 = ''
        while i  < len(data):
            index_first = data[i]
            index_last = data[i+1]
            str_1 += chr(int(index_first + index_last, 16))
            i += max(2, 2 * (j - 1))
        if '|' not in str_1:
            data = ""
            str_1 = ''.join(reversed(str_1))
            result += str_1
            break
        elif str_1.index('|') > len(str_1) // 2:
            str_1 = ''.join(reversed(str_1))
        data = str_1[str_1.index("|") + 2:]
        result += str_1[:str_1.index("|") + 2]
        j += 1
except:
    pass

print(result)
print(data)